INSERT [dbo].[Recipes] ([RecipeID], [RecipeName], [Recipe], [Duration], [Image], [Descriptions], [Servings], [Facts], [RecipeCategoryID], [Bookmarks]) VALUES (1, N'Vegetable Rice', N'Ingredients

120 grams of Astra
6 lightly beaten eggs
6 crushed garlic cloves
15 grams of finely chopped ginger
1 coasely chopped onions
150 grams of carrot finely diced
150 grams of leeks finely diced
150 grams of drumstick (murunga) leaves

Method

Cook the basmati rice in a pot and let it cool.
Heat Astra in a wok and sauté ginger, garlic and onions for a few minutes or until cooked.
Add the beaten eggs and fry well while stirring.
Then, add in carrot and onion. Next, add in leeks and drumstick leaves. Sauté for few minutes.
Finally, pout in the rice and stir continuously to keep the rice light and fluffy and to prevent the rice from sticking on the base of the pan.
Garnish with spring onions or cashew nuts and present!', N'10 min', , N'Easy Mixed Vegetable Rice', 8, N'Calories from Fat 40. Calories 281.
7% Total Fat 4.4g.
2% Saturated Fat 0.4g.
0% Cholesterol 0mg.
42% Sodium 1014mg.
6% Potassium 204mg.
18% Total Carbohydrates 54g', 3, 0)
INSERT [dbo].[Recipes] ([RecipeID], [RecipeName], [Recipe], [Duration], [Image], [Descriptions], [Servings], [Facts], [RecipeCategoryID], [Bookmarks]) VALUES (2, N'Egg Rice', N'Ingredients

Eggs  04
Carrot  01
Leeks / Spring Onion  150g
Big Onion  01
Margarine  03 tbsp
Ginger
Garlic  05  06 cloves
Pepper Powder  02 tsp
Cardamom  04
Cloves  04
Few Cinnamon Sticks
Rampe
Curry Leaves
Green Chilies  02
Salt  02 tsp
Chili Pieces  ½ tsp
Cooked Rice (Basmathi / Keeri Samba)

Method

Cut all the vegetables that we need for the fried rice.
Make a ginger garlic paste.
Crush cardamom and cloves.
Put eggs into a pan and add salt and pepper. Scramble these eggs on low fire while stirring continuously.
Heat margarine in a pan and add ginger garlic paste, crushed cardamom cloves and cinnamon.
Add rampe, curry leaves, onions and green chilies.
Add chili pieces, salt and pepper powder.
Add carrots into the mixture and sauté around 02 mins until carrots become smooth.
Add leeks and mix. At this stage adjust salt and pepper as per your taste.
Then add scrambled eggs.
Finally add cooked rice and mix thoroughly with the mixture. When you cook rice for this recipe add some margarine or ghee. Then rice wont get sticky.
Since we put lots of vegetables into this rice you can eat this even without any curries.', N'30 mins', , N'This quick and easy delicious Egg Fried Rice is a perfect recipe for those how doesn''t want to spend more time in cooking.', 6, N'Energy	217 cal	
Protein	5.7 g	
Carbohydrates	28.6 g
Fiber	1.4 g', 3, 1)
INSERT [dbo].[Recipes] ([RecipeID], [RecipeName], [Recipe], [Duration], [Image], [Descriptions], [Servings], [Facts], [RecipeCategoryID], [Bookmarks]) VALUES (3, N'Watalappan', N'Ingredients

6 eggs
250gms palm jaggery (cane sugar)- this can be replaced with any other type available
2 cups coconut milk
70 gms brown sugar
1 tsp cardamom powder
50gms chopped cashew nuts
1 vanilla pod
½ cup water

Method

Preheat the oven at 120 C.
Pour water into a pot and add jaggery on low heat.
Once the jaggery has completely melted, remove from theat and allow it to cool.
Beat the eggs and gradually add the melted jaggery and coconut to it.
Add and mix the cardamom powder, beans from the vanilla pod and brown sugar.
Pour the mixture in a baking tray and place this baking tray in another tray filled with water.
Place the baking tray in the oven and bake for 50-minutes.
You will know its done when its wobbly in the centre.
Let it cool. It can also be refrigerated.
Sprinkle with chopped cashew nuts and serve with vanilla ice-cream. This dessert can be served hot or cold.', N'1 hr 30 mins', , N'Desserts like steamed caramel custard can be found across the globe.', 6, N'Energy (Kcal)     535.35
Carbohydrate(g)    66.78
Protein (g)   13.98
Fat (g)   23.5', 4, 0)
INSERT [dbo].[Recipes] ([RecipeID], [RecipeName], [Recipe], [Duration], [Image], [Descriptions], [Servings], [Facts], [RecipeCategoryID], [Bookmarks]) VALUES (4, N'Chicken Curry', N'ingredients

4 chicken thighs
½ an onion, sliced
2 garlic cloves, chopped
2 green chillies, sliced
1 Knorr Chicken Cube
1 cinnamon stick
2 tablespoons coconut oil
2-3 cardamom seeds
2 cloves
2 tablespoons tamarind juice
2 tablespoons roasted curry powder
½ teaspoon turmeric
1 tablespoon chilli powder
2 cups coconut milk
Curry leaves & Rampe
Salt to taste

method

Heat coconut oil in a saucepan and add garlic, onion, green chilli, cardamom, cloves, cinnamon stick, rampe and curry leaves. Sauté for a few minutes.
Add chicken thighs, Knorr Chicken Cube, turmeric, roasted curry powder, chilli powder, tamarind juice and coconut milk into the saucepan. Cook till the chicken is done and the gravy is thick.
Correct seasoning and pour curry into a serving bowl. Garnish with tomato wedges or thinly sliced green chillies on top (optional) and serve hot.', N'1 hr', , N'Classic Sri Lankan Chicken Curry recipe that is so easy and simple to make. Always comes out super delicious.', 4, N'Saturated Fat 1.5ggrams
Trans Fat 0.2ggrams
Polyunsaturated Fat 5.5ggrams
Monounsaturated Fat 2.9g', 5, 0)
